import React from 'react';
import { InputsContainer } from '../LoginPage/styled';
import { Button, TextField } from '@material-ui/core';
import useForm from '../../hooks/useForm';


export default function SingUpForm() {
    const [form, onChange, clear] = useForm({ email: "", password: "", name: "" })

    const onSubmit = (e) => {
        e.preventDefault()
        SingUp(form, clear, history)
    };

    const onSubmitForm = (e) => {
        e.preventDefault()
        login(form, clear, history)
    };
    return (
        <InputsContainer>
            <form onSubmit={onSubmit}>

                <TextField
                    name={"name"}
                    value={form.name}
                    onChange={onChange}
                    label={"Nome"}
                    variant={'outlined'}
                    fullWidth
                    margin={"normal"}
                    required
                    type={"password"}
                    clear={clear}
                />
                <TextField
                    name={"email"}
                    value={form.email}
                    onChange={onChange}
                    label={"E-mail"}
                    variant={'outlined'}
                    fullWidth
                    margin={"normal"}
                    required
                    type={"email"}
                    clear={clear}
                />
                <TextField
                    name={"password"}
                    value={form.password}
                    onChange={onChange}
                    label={"Senha"}
                    variant={'outlined'}
                    fullWidth
                    margin={"normal"}
                    required
                    type={"password"}
                />
                <Button
                    type={'submit'}
                    fullWidth
                    variant={'contained'}
                    color={'primary'}
                >Fazer Cadastro</Button>
            </form>

        </InputsContainer>

    );





};
